pragma solidity ^0.8.0;

import "../Repository/Repository.sol";

bytes32 constant RANDOM = keccak256("Random");

contract Random is RepositoryContract {

    function id() public view returns (bytes32) {return RANDOM;}

    uint256 private _fee;
    uint256 private _ptr;
    uint256 private _ptrstart;
    uint256 private _count;
    uint256 private _lastrandom;

    mapping(uint256 => uint256) private _usedrandoms;
    mapping(uint256 => uint256[256]) private _randoms;

    event RandomRemaining(uint256 count);
    event RandomReset(uint256 count);

    constructor(Repository rep_) RepositoryContract(rep_) {}

    function setFee(uint256 fee_) public onlyOperators {
        _fee = fee_;
    }

    function fee() public view returns (uint256) {
        return _fee;
    }

    function count() public view returns (uint256) {
        return _count;
    }

    function purgeall() public onlyOwner {
        _ptrstart = _ptr;
        _count = 0;
    }

    function collect() public onlyOperators {
        payable(_msgSender()).transfer(address(this).balance);
    }

    function add(uint256[256] calldata newrandoms_) public onlyOperators {
        unchecked {
            _count += 256;
            _randoms[_ptr++] = newrandoms_;
        }
    }

    function get(uint256 random_) public payable returns (uint256) {
        if (
            _msgSender() != ownerOf() &&
            !rep.isContract(_msgSender()) &&
            !rep.isOperator(_msgSender())
        ) {
            require(_fee != 0, "desactivated");
            require(msg.value >= _fee, "Must pay fee");
            if (msg.value > _fee)
                payable(_msgSender()).transfer(msg.value-_fee);
        }
        for (
            uint256 i = block.number > 10 ? block.number - 10 : 1;
            i < block.number;
            i++
        ) random_ = uint256(keccak256(abi.encode(random_, blockhash(i))));
        random_ = uint256(keccak256(abi.encode(random_, _lastrandom)));
        uint8 k = uint8(random_ % 256);
        if (_count == 0) {
            _ptrstart = 0;
            for (uint256 p = _ptrstart; p < _ptr; p++) delete _usedrandoms[p];
            _count = _ptr * 256;
            emit RandomReset(_count);
        }
        unchecked {
            for (uint8 b = 0; b < 256; b++) {
                uint8 ki = k - b;
                for (uint256 p = _ptrstart; p < _ptr; p++)
                    if (_usedrandoms[p] & (1 << ki) == 0) {
                        _usedrandoms[p] |= 1 << ki;

                        random_ = _randoms[p][ki];
                        for (
                            uint256 i = block.number > 10
                                ? block.number - 10
                                : 1;
                            i < block.number;
                            i++
                        )
                            random_ = uint256(
                                keccak256(abi.encode(random_, blockhash(i)))
                            );
                        _lastrandom = random_;
                        _count--;
                        while (_usedrandoms[_ptrstart] == type(uint256).max)
                            _ptrstart++;
                        if (_count % 256 == 0) emit RandomRemaining(_count);
                        return random_;
                    }
            }
            require(false, "no random available");
        }
    }

    function getfree(uint256 random_) public view returns (uint256) {
        for (
            uint256 i = block.number > 20 ? block.number - 20 : 1;
            i < block.number;
            i++
        ) random_ = uint256(keccak256(abi.encode(random_, blockhash(i))));
        random_ = uint256(keccak256(abi.encode(random_, _lastrandom)));
        unchecked {
            if (_ptrstart != _ptr) {
                uint256 k = uint8(random_ % (256 * _ptr));
                random_ = _randoms[k / 256][k % 256];
                for (
                    uint256 i = block.number > 20 ? block.number - 20 : 1;
                    i < block.number;
                    i++
                )
                    random_ = uint256(
                        keccak256(abi.encode(random_, blockhash(i)))
                    );
            }
        }
        return random_;
    }
}
